<!DOCTYPE html>
<html>
<head>
<meta charset="utf-8" />
<title>leaflet</title>
<style type="text/css">@layer htmltools {
.html-fill-container {
display: flex;
flex-direction: column;

min-height: 0;
min-width: 0;
}
.html-fill-container > .html-fill-item {

flex: 1 1 auto;
min-height: 0;
min-width: 0;
}
.html-fill-container > :not(.html-fill-item) {

flex: 0 0 auto;
}
}

#cv-button {
  position: absolute;
  top: 10px;
  right: 10px;
  z-index: 1000;
  background: rgba(255, 255, 255, 0.9);
  border-radius: 4px;
  padding: 8px 12px;
  box-shadow: 0 1px 5px rgba(0,0,0,0.4);
  transition: all 0.2s ease;
}

.cv-download {
  display: flex;
  flex-direction: column;
  align-items: center;
  text-decoration: none;
  color: #333;
  font-weight: 600;
  font-size: 14px;
}

.cv-subtext {
  font-size: 10px;
  color: #666;
  margin-top: 2px;
}

#cv-button:hover {
  background: #fff;
  transform: translateY(-1px);
  box-shadow: 0 2px 8px rgba(0,0,0,0.3);
}

/* Mobile optimization */
@media (max-width: 768px) {
  #cv-button {
    top: 5px;
    right: 5px;
    padding: 6px 10px;
  }
  
  .cv-download {
    font-size: 13px;
  }
}

<style type="text/css">
img.leaflet-tile {
padding: 0;
margin: 0;
border-radius: 0;
border: none;
}
.leaflet .info {
padding: 6px 8px;
font: 14px/16px Arial, Helvetica, sans-serif;
background: white;
background: rgba(255,255,255,0.8);
box-shadow: 0 0 15px rgba(0,0,0,0.2);
border-radius: 5px;
}
.leaflet .legend {
line-height: 18px;
color: #555;
}
.leaflet .legend svg text {
fill: #555;
}
.leaflet .legend svg line {
stroke: #555;
}
.leaflet .legend i {
width: 18px;
height: 18px;
margin-right: 4px;
opacity: 0.7;
display: inline-block;
vertical-align: top;

zoom: 1;
*display: inline;
